      let ctx = c.getContext("2d");
      let ctx_l = c_l.getContext("2d");
      let ctx_s = c_s.getContext("2d");
      ctx.globalCompositeOperation = "xor";
      ctx.shadowBlur = 10;
      ctx.shadowColor = "#fff";
