        ctx.lineTo(PL_Size + X, PL_Size + Y - radius);
        ctx.arc(PL_Size - radius + X, PL_Size - radius + Y, radius, 0, Math.PI * 1 / 2);
        ctx.lineTo(radius + X, PL_Size + Y);
